function [alpha]=t_alpha(t, nu)
% % t_alpha:  cumulative probability function of the t-distribution, 
% %
% % Syntax='';
% %
% % [alpha]=t_alpha(t, nu);
% %
% % ***********************************************************
% %
% % Description
% %
% % This program calculates the student-t confidence level given
% % the statistic t, with nu degrees of freedom.  t can be a vector.  
% % t can handle values of -Inf, 0, and Inf. nu should be a constant.  
% %
% % In more technical language this program is the cumulative probability 
% % density function for the t-distribution.  
% %
% % For t less than 0, the alpha is less than 0.5.
% %
% % t=1 is the default measured value of the statistic.
% %
% % nu is the number of degrees of freedom.  The default value of nu is Inf.
% %    By default the normal distribution approximation is used.
% %
% % For values of nu in the range 1 <= nu <= 170,  analytical solutions
% % are used and the accuracy can be to machine precision.
% %
% % For values of nu in the range 171 <= nu <= 320, the generalized
% % hypergeometric funciton solution is used.  Some of the numbers are quite
% % large and rounding errors and other computation problems are a
% % possiblility.  The tolerance is hard coded to 10.^(-15).  Calculations
% % can have 8 digits or more of accuracy; however,
% % compuational problems can arise.
% %
% % For values of nu in the range 321 <= nu <= Inf, the normal distribution
% % approximation is used, because the hypergeometric function crashes due
% % to computational problems (large numers and small step sizes).
% %
% % ***********************************************************
% %
% % Input Variables
% %
% % t is the measured statistic value -Inf < t < Inf.
% %
% % nu is the number of degree of freedom 1 <= nu < Inf.
% %
% % ***********************************************************
% %
% % Output Variables
% %
% % alpha   % student-t level of significance, cumulative probability
% %
% % ***********************************************************
% %
% Example='';
%
% t=1;         % statistic
% nu=Inf;      % number of degrees of freedom
%
% [alpha]=t_alpha(t, nu);
%
% t=1;
% nu=10;
% [alpha2]=t_alpha(t, nu);
%
% %
% % ***********************************************************
% %
% % This program was written by Edward L. Zechmann
% %
% %     date 20 January   2008
% %
% % modified 30 January   2008   made regimes integrate from t0=0.
% %                              increased speed of program
% %
% % modified  8 March     2008   Implemented the analytical solution to the
% %                              cumulative probability function.
% %                              Maple was used to derive the solutions.
% %
% % modified  9 March     2008   Added additional analytical solutions
% %                              Updated comments.
% % 
% % modified 11 September 2008   Updated Comments
% %
% % ***********************************************************
% %
% % Feel free to modify this code.
% %

if nargin < 1 || isempty(t) || ~isnumeric(t)
    t=1;
end

if nargin < 2 || isempty(nu) || logical(nu < 1)  || ~isnumeric(nu)
    nu=Inf;
end

nu=round(nu(1));

% Check special cases of t 
% set the values of alpha for the special cases
n1=length(t);

alpha=zeros(size(t));
ix=ismember(-Inf, t );

set_t=setdiff(1:n1, ix);

if ~isempty(ix)
    alpha(ix)=0;
end

ix=ismember(Inf,t);
set_t=setdiff(set_t, ix);

if ~isempty(ix)
    alpha(ix)=1;
end

ix=ismember(0,t);
set_t=setdiff(set_t, ix);

if ~isempty(ix)
    alpha(ix)=0.5;
end


t=t(set_t);

% make sure t is not empty before checking special casaes of nu

if ~isempty(t)
    % Check special cases of nu
    % nu < 171 analytical solutions
    % 171 <= nu <= 320 Generalized Hypergeometric solution
    % nu >= 321 normal distribution approximation
    switch nu
        case 1;
            alpha(set_t)=1./2+1./pi.*atan(t);

        case 2;
            alpha(set_t)=1./2+1./2.*t./(2+t.^2).^(1./2);

        case 3;
            alpha(set_t)=1./2+1./pi.*atan(1./3.*t.*3.^(1./2))+1./pi.*t.*3.^(1./2)./(3+t.^2);

        case 4;
            alpha(set_t)=1./2+1./2.*t./(4+t.^2).^(1./2).*(1+1./2./(1+1./4.*t.^2));

        case 5;
            alpha(set_t)=1./2+1./pi.*atan(1./5.*t.*5.^(1./2))+1./pi.*t.*5.^(1./2)./(5+t.^2).*(1+2./3./(1+1./5.*t.^2));

        case 6;
            alpha(set_t)=1./2+1./2.*t./(6+t.^2).^(1./2).*(1+1./2./(1+1./6.*t.^2)+3./8./(1+1./6.*t.^2).^2);

        case 7;
            alpha(set_t)=1./2+1./pi.*atan(1./7.*t.*7.^(1./2))+1./pi.*t.*7.^(1./2)./(7+t.^2).*(1+2./3./(1+1./7.*t.^2)+8./15./(1+1./7.*t.^2).^2);

        case 8;
            alpha(set_t)=1./2+1./2.*t./(8+t.^2).^(1./2).*(1+1./2./(1+1./8.*t.^2)+3./8./(1+1./8.*t.^2).^2+5./16./(1+1./8.*t.^2).^3);

        case 9;
            alpha(set_t)=1./2+1./pi.*atan(1./9.*t.*9.^(1./2))+1./pi.*t.*9.^(1./2)./(9+t.^2).*(1+2./3./(1+1./9.*t.^2)+8./15./(1+1./9.*t.^2).^2+16./35./(1+1./9.*t.^2).^3);

        case 10;
            alpha(set_t)=1./2+1./2.*t./(10+t.^2).^(1./2).*(1+1./2./(1+1./10.*t.^2)+3./8./(1+1./10.*t.^2).^2+5./16./(1+1./10.*t.^2).^3+35./128./(1+1./10.*t.^2).^4);

        case 11;
            alpha(set_t)=1./2+1./pi.*atan(1./11.*t.*11.^(1./2))+1./pi.*t.*11.^(1./2)./(11+t.^2).*(1+2./3./(1+1./11.*t.^2)+8./15./(1+1./11.*t.^2).^2+16./35./(1+1./11.*t.^2).^3+128./315./(1+1./11.*t.^2).^4);

        case 12;
            alpha(set_t)=1./2+1./2.*t./(12+t.^2).^(1./2).*(1+1./2./(1+1./12.*t.^2)+3./8./(1+1./12.*t.^2).^2+5./16./(1+1./12.*t.^2).^3+35./128./(1+1./12.*t.^2).^4+63./256./(1+1./12.*t.^2).^5);

        case 13;
            alpha(set_t)=1./2+1./pi.*atan(1./13.*t.*13.^(1./2))+1./pi.*t.*13.^(1./2)./(13+t.^2).*(1+2./3./(1+1./13.*t.^2)+8./15./(1+1./13.*t.^2).^2+16./35./(1+1./13.*t.^2).^3+128./315./(1+1./13.*t.^2).^4+256./693./(1+1./13.*t.^2).^5);

        case 14;
            alpha(set_t)=1./2+1./2.*t./(14+t.^2).^(1./2).*(1+1./2./(1+1./14.*t.^2)+3./8./(1+1./14.*t.^2).^2+5./16./(1+1./14.*t.^2).^3+35./128./(1+1./14.*t.^2).^4+63./256./(1+1./14.*t.^2).^5+231./1024./(1+1./14.*t.^2).^6);

        case 15;
            alpha(set_t)=1./2+1./pi.*atan(1./15.*t.*15.^(1./2))+1./pi.*t.*15.^(1./2)./(15+t.^2).*(1+2./3./(1+1./15.*t.^2)+8./15./(1+1./15.*t.^2).^2+16./35./(1+1./15.*t.^2).^3+128./315./(1+1./15.*t.^2).^4+256./693./(1+1./15.*t.^2).^5+1024./3003./(1+1./15.*t.^2).^6);

        case 16;
            alpha(set_t)=1./2+1./2.*t./(16+t.^2).^(1./2).*(1+1./2./(1+1./16.*t.^2)+3./8./(1+1./16.*t.^2).^2+5./16./(1+1./16.*t.^2).^3+35./128./(1+1./16.*t.^2).^4+63./256./(1+1./16.*t.^2).^5+231./1024./(1+1./16.*t.^2).^6+429./2048./(1+1./16.*t.^2).^7);

        case 17;
            alpha(set_t)=1./2+1./pi.*atan(1./17.*t.*17.^(1./2))+1./pi.*t.*17.^(1./2)./(17+t.^2).*(1+2./3./(1+1./17.*t.^2)+8./15./(1+1./17.*t.^2).^2+16./35./(1+1./17.*t.^2).^3+128./315./(1+1./17.*t.^2).^4+256./693./(1+1./17.*t.^2).^5+1024./3003./(1+1./17.*t.^2).^6+2048./6435./(1+1./17.*t.^2).^7);

        case 18;
            alpha(set_t)=1./2+1./2.*t./(18+t.^2).^(1./2).*(1+1./2./(1+1./18.*t.^2)+3./8./(1+1./18.*t.^2).^2+5./16./(1+1./18.*t.^2).^3+35./128./(1+1./18.*t.^2).^4+63./256./(1+1./18.*t.^2).^5+231./1024./(1+1./18.*t.^2).^6+429./2048./(1+1./18.*t.^2).^7+6435./32768./(1+1./18.*t.^2).^8);

        case 19;
            alpha(set_t)=1./2+1./pi.*atan(1./19.*t.*19.^(1./2))+1./pi.*t.*19.^(1./2)./(19+t.^2).*(1+2./3./(1+1./19.*t.^2)+8./15./(1+1./19.*t.^2).^2+16./35./(1+1./19.*t.^2).^3+128./315./(1+1./19.*t.^2).^4+256./693./(1+1./19.*t.^2).^5+1024./3003./(1+1./19.*t.^2).^6+2048./6435./(1+1./19.*t.^2).^7+32768./109395./(1+1./19.*t.^2).^8);

        case 20;
            alpha(set_t)=1./2+1./2.*t./(20+t.^2).^(1./2).*(1+1./2./(1+1./20.*t.^2)+3./8./(1+1./20.*t.^2).^2+5./16./(1+1./20.*t.^2).^3+35./128./(1+1./20.*t.^2).^4+63./256./(1+1./20.*t.^2).^5+231./1024./(1+1./20.*t.^2).^6+429./2048./(1+1./20.*t.^2).^7+6435./32768./(1+1./20.*t.^2).^8+12155./65536./(1+1./20.*t.^2).^9);

