        case 22;
            alpha(set_t)=1./2+1./2.*t./(22+t.^2).^(1./2).*(1+1./2./(1+1./22.*t.^2)+3./8./(1+1./22.*t.^2).^2+5./16./(1+1./22.*t.^2).^3+35./128./(1+1./22.*t.^2).^4+63./256./(1+1./22.*t.^2).^5+231./1024./(1+1./22.*t.^2).^6+429./2048./(1+1./22.*t.^2).^7+6435./32768./(1+1./22.*t.^2).^8+12155./65536./(1+1./22.*t.^2).^9+46189./262144./(1+1./22.*t.^2).^10);

        case 23;
            alpha(set_t)=1./2+1./pi.*atan(1./23.*t.*23.^(1./2))+1./pi.*t.*23.^(1./2)./(23+t.^2).*(1+2./3./(1+1./23.*t.^2)+8./15./(1+1./23.*t.^2).^2+16./35./(1+1./23.*t.^2).^3+128./315./(1+1./23.*t.^2).^4+256./693./(1+1./23.*t.^2).^5+1024./3003./(1+1./23.*t.^2).^6+2048./6435./(1+1./23.*t.^2).^7+32768./109395./(1+1./23.*t.^2).^8+65536./230945./(1+1./23.*t.^2).^9+262144./969969./(1+1./23.*t.^2).^10);

        case 24;
            alpha(set_t)=1./2+1./2.*t./(24+t.^2).^(1./2).*(1+1./2./(1+1./24.*t.^2)+3./8./(1+1./24.*t.^2).^2+5./16./(1+1./24.*t.^2).^3+35./128./(1+1./24.*t.^2).^4+63./256./(1+1./24.*t.^2).^5+231./1024./(1+1./24.*t.^2).^6+429./2048./(1+1./24.*t.^2).^7+6435./32768./(1+1./24.*t.^2).^8+12155./65536./(1+1./24.*t.^2).^9+46189./262144./(1+1./24.*t.^2).^10+88179./524288./(1+1./24.*t.^2).^11);

        case 25;
            alpha(set_t)=1./2+1./pi.*atan(1./25.*t.*25.^(1./2))+1./pi.*t.*25.^(1./2)./(25+t.^2).*(1+2./3./(1+1./25.*t.^2)+8./15./(1+1./25.*t.^2).^2+16./35./(1+1./25.*t.^2).^3+128./315./(1+1./25.*t.^2).^4+256./693./(1+1./25.*t.^2).^5+1024./3003./(1+1./25.*t.^2).^6+2048./6435./(1+1./25.*t.^2).^7+32768./109395./(1+1./25.*t.^2).^8+65536./230945./(1+1./25.*t.^2).^9+262144./969969./(1+1./25.*t.^2).^10+524288./2028117./(1+1./25.*t.^2).^11);

        case 26;
            alpha(set_t)=1./2+1./2.*t./(26+t.^2).^(1./2).*(1+1./2./(1+1./26.*t.^2)+3./8./(1+1./26.*t.^2).^2+5./16./(1+1./26.*t.^2).^3+35./128./(1+1./26.*t.^2).^4+63./256./(1+1./26.*t.^2).^5+231./1024./(1+1./26.*t.^2).^6+429./2048./(1+1./26.*t.^2).^7+6435./32768./(1+1./26.*t.^2).^8+12155./65536./(1+1./26.*t.^2).^9+46189./262144./(1+1./26.*t.^2).^10+88179./524288./(1+1./26.*t.^2).^11+676039./4194304./(1+1./26.*t.^2).^12);

        case 27;
            alpha(set_t)=1./2+1./pi.*atan(1./27.*t.*27.^(1./2))+1./pi.*t.*27.^(1./2)./(27+t.^2).*(1+2./3./(1+1./27.*t.^2)+8./15./(1+1./27.*t.^2).^2+16./35./(1+1./27.*t.^2).^3+128./315./(1+1./27.*t.^2).^4+256./693./(1+1./27.*t.^2).^5+1024./3003./(1+1./27.*t.^2).^6+2048./6435./(1+1./27.*t.^2).^7+32768./109395./(1+1./27.*t.^2).^8+65536./230945./(1+1./27.*t.^2).^9+262144./969969./(1+1./27.*t.^2).^10+524288./2028117./(1+1./27.*t.^2).^11+4194304./16900975./(1+1./27.*t.^2).^12);

        case 28;
