        case 33;
            alpha(set_t)=1./2+1./pi.*atan(1./33.*t.*33.^(1./2))+1./pi.*t.*33.^(1./2)./(33+t.^2).*(1+2./3./(1+1./33.*t.^2)+8./15./(1+1./33.*t.^2).^2+16./35./(1+1./33.*t.^2).^3+128./315./(1+1./33.*t.^2).^4+256./693./(1+1./33.*t.^2).^5+1024./3003./(1+1./33.*t.^2).^6+2048./6435./(1+1./33.*t.^2).^7+32768./109395./(1+1./33.*t.^2).^8+65536./230945./(1+1./33.*t.^2).^9+262144./969969./(1+1./33.*t.^2).^10+524288./2028117./(1+1./33.*t.^2).^11+4194304./16900975./(1+1./33.*t.^2).^12+8388608./35102025./(1+1./33.*t.^2).^13+33554432./145422675./(1+1./33.*t.^2).^14+67108864./300540195./(1+1./33.*t.^2).^15);

        case 34;
